<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Edit Data Umat</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="Edit_Data_Umat.css"/>
<script id="applicationScript" type="text/javascript" src="Edit_Data_Umat.js"></script>
</head>
<body>
<div id="Edit_Data_Umat">
	<svg class="Header_s">
		<linearGradient id="Header_s" spreadMethod="pad" x1="0.5" x2="0.5" y1="0" y2="1">
			<stop offset="0" stop-color="#f6c130" stop-opacity="1"></stop>
			<stop offset="1" stop-color="#fff" stop-opacity="1"></stop>
		</linearGradient>
		<rect id="Header_s" rx="0" ry="0" x="0" y="0" width="1280" height="224">
		</rect>
	</svg>
	<div id="Paroki_Santo_Stefanus_Purwosar">
		<span>Paroki Santo Stefanus Purwosari<br/>Keuskupan Agung Purwokerto</span>
	</div>
	<svg class="TempatTabel">
		<rect id="TempatTabel" rx="32" ry="32" x="0" y="0" width="955" height="469">
		</rect>
	</svg>
	<div id="Data_Umat">
		<span>Data Umat</span>
	</div>
	<svg class="ButtonEdit">
		<rect id="ButtonEdit" rx="9" ry="9" x="0" y="0" width="122" height="53">
		</rect>
	</svg>
	<div id="EDIT">
		<span>EDIT</span>
	</div>
	<div id="No_KTP">
		<span>No. KTP</span>
	</div>
	<div id="Nama">
		<span>Nama</span>
	</div>
	<div id="No_Telp">
		<span>No. Telp</span>
	</div>
	<div id="Alamat">
		<span>Alamat</span>
	</div>
	<div id="Password">
		<span>Password</span>
	</div>
	<div id="Email">
		<span>Email</span>
	</div>
	<div onclick="application.goToTargetView(event)" id="Jadwal_Misa">
		<span>Jadwal Misa</span>
	</div>
	<div onclick="application.goToTargetView(event)" id="Reservasi">
		<span>Reservasi</span>
	</div>
	<div onclick="application.goToTargetView(event)" id="Home">
		<span>Home</span>
	</div>
	<div onclick="application.goToTargetView(event)" id="Logout">
		<span>Logout</span>
	</div>
</div>
</body>
</html>
